function HelloWorld() {
return
<div>
  <Hello/> <World/>!
  </div>;
}

function Hello() {
  return (<span>Hello</span>);
}

function World() {
  return(<span>World</span>);
}
ReactDOM.render(<HelloWorld/>,
document.querySelector('#root'));
